import React from 'react';
import { List } from 'semantic-ui-react'
import './cards.css'
import CardItem from './carditem'

export const Card = ({ listOfStocks, listOfPrices })=> {
  var counter = 0;
  return (
    <>
      <div className='cards'>
        <div className='cards__container'>
          <div className='cards__wrapper'>

            {listOfStocks.map(stocks => {
              var price = listOfPrices[counter];
              counter++;
              return (
                <ul className='cards__items'><CardItem text={stocks} label='Stock' counter={counter} price={price}/></ul>
              );
            })}

          </div>
        </div>
      </div>
    </>
  )
}

